INSERT INTO `Resource` VALUES (2,5,'Algorithm, Part I - Week 2:Elementary Sorts','We introduce the sorting problem and Java\'s Comparable interface. We study two elementary sorting methods (selection sort and insertion sort) and a variation of one of them (shellsort). We also consider two algorithms for uniformly shuffling an array. We conclude with an application of sorting to computing the convex hull via the Graham scan algorithm.',NULL,NULL,NULL,'4'),(3,5,'Algorithm, Part I - Week3:Mergesort','We study the mergesort algorithm and show that it guarantees to sort any array of N items with at most N lg N compares. We also consider a nonrecursive, bottom-up version. We prove that any compare-based sorting algorithm must make at least ~ N lg N compares in the worst case. We discuss using different orderings for the objects that we are sorting and the related concept of stability.',NULL,NULL,NULL,'4'),(4,5,'Algorithm, Part I - Week3:Quicksort','We introduce and implement the randomized quicksort algorithm and analyze its performance. We also consider randomized quickselect, a quicksort variant which finds the kth largest item in linear time. Finally, we consider 3-way quicksort, a variant of quicksort that works especially well in the presence of duplicate keys.',NULL,NULL,NULL,'4'),(5,2,'2.1：判断一个正整数是否为质数的算法-u013963052的专栏-博客频道-CSDN.NET',NULL,'0',NULL,'http://blog.csdn.net/u013963052/article/details/21484981','6'),(6,2,'2.1：判断一个正整数是否为质数的算法.-u013986424的专栏-博客频道-CSDN.NET',NULL,'0',NULL,'http://blog.csdn.net/u013986424/article/details/21520785','8'),(7,2,'2.1：判断一个正整数是否为质数的算法。-u014007551的专栏-博客频道-CSDN.NET',NULL,'0',NULL,'http://blog.csdn.net/u014007551/article/details/21410091','17'),(8,2,'2.1：判断一个正整数是否为质数的算法计科1114岑思远03-carsonqiangda的专栏-博客频道-CSDN.NET',NULL,'0',NULL,'http://blog.csdn.net/carsonqiangda/article/details/21347775','71'),(9,2,'2.1：判断一个正整数是否为质数的算法-知识就是力量---培根-博客频道-CSDN.NET',NULL,'0',NULL,'http://blog.csdn.net/u012090893/article/details/21493323','7'),(10,2,'ApacheM